package topicbrowser

import (
	"encoding/hex"
	"strings"
	"testing"

	s6svc "github.com/united-manufacturing-hub/united-manufacturing-hub/umh-core/pkg/service/s6"
)

const EXAMPLE_BLOCK = `
STARTSTARTSTART













ENDDATAENDDATAENDDATA
1751378851184
ENDENDENDEND
`

func BenchmarkExtractRaw(b *testing.B) {
	// Slice blocks by line and create a s6svc.LogEntry
	var logEntries []s6svc.LogEntry
	for _, line := range strings.Split(EXAMPLE_BLOCK, "\n") {
		logEntries = append(logEntries, s6svc.LogEntry{Content: line})
	}
	b.ResetTimer()
	for i := 0; i < b.N; i++ {
		hexBuf, epoch, err := extractRaw(logEntries)
		if err != nil || len(hexBuf) == 0 {
			b.Fatal(err) // Use b.Fatal instead of return err in benchmark
		}
		_ = hexBuf // Prevent unused variable warning
		_ = epoch  // Prevent unused variable warning
	}
}

func BenchmarkHexDecode(b *testing.B) {
	// Slice blocks by line and create a s6svc.LogEntry
	var logEntries []s6svc.LogEntry
	for _, line := range strings.Split(EXAMPLE_BLOCK, "\n") {
		logEntries = append(logEntries, s6svc.LogEntry{Content: line})
	}
	hexBuf, _, err := extractRaw(logEntries)
	if err != nil || len(hexBuf) == 0 {
		b.Fatal(err) // Use b.Fatal instead of return err in benchmark
	}

	b.ResetTimer()
	for i := 0; i < b.N; i++ {
		compressed := make([]byte, hex.DecodedLen(len(hexBuf)))
		if _, err := hex.Decode(compressed, hexBuf); err != nil {
			b.Fatal(err)
		}
	}
}

