func TestCompressionRatio(t *testing.T) {
	// Slice blocks by line and create a s6svc.LogEntry
	var logEntries []s6svc.LogEntry
	for _, line := range strings.Split(EXAMPLE_BLOCK, "\n") {
		logEntries = append(logEntries, s6svc.LogEntry{Content: line})
	}
	hexBuf, _, err := extractRaw(logEntries)
	if err != nil || len(hexBuf) == 0 {
		t.Fatal(err)
	}

	compressed := make([]byte, hex.DecodedLen(len(hexBuf)))
	if _, err := hex.Decode(compressed, hexBuf); err != nil {
		t.Fatal(err)
	}

	payload, err := decompressBlock(compressed)
	if err != nil {
		t.Fatal(err)
	}

	uncompressedSize := len(payload)
	compressedSize := len(compressed)
	compressionRatio := float64(compressedSize) / float64(uncompressedSize)

	t.Logf("Uncompressed size: %d bytes", uncompressedSize)
	t.Logf("Compressed size: %d bytes", compressedSize)
	t.Logf("Compression ratio: %.2f%%", compressionRatio*100)
	t.Logf("Space saved: %.2f%%", (1-compressionRatio)*100)

	// Assert that compression is actually working (compressed size should be smaller)
	if compressedSize >= uncompressedSize {
		t.Errorf("Compression not effective: compressed size (%d) >= uncompressed size (%d)",
			compressedSize, uncompressedSize)
	}
}
